import React from 'react';
import '../css/Contact.css'; // Ensure you have this CSS file for styling

const Contact = () => {
  return (
    <div className="contact-container">
      <h1 className="contact-title">Contact Me</h1>
      <section className="contact-info">
        <h2 className="contact-subtitle">Get in Touch</h2>
        <p>If you'd like to discuss potential opportunities, collaborate on projects, or just connect, feel free to reach out to me. I am always open to new challenges and conversations with like-minded professionals.</p>
        <ul className="contact-details">
          <li><strong>Email:</strong> <a href="mailto:kavinparikh20@gmail.com" className="contact-link">kavinparikh20@gmail.com</a></li>
          <li><strong>LinkedIn:</strong> <a href="https://www.linkedin.com/in/kavin-parikh" className="contact-link" target="_blank" rel="noopener noreferrer">linkedin.com/in/kavin-parikh</a></li>
          <li><strong>GitHub:</strong> <a href="https://github.com/yourusername" className="contact-link" target="_blank" rel="noopener noreferrer">github.com/yourusername</a></li>
        </ul>
      </section>
    </div>
  );
};

export default Contact;
